import React from 'react';

const CompTime = () => {
  useS
  return (
    <div className='now'>
      
      <time>
        <b>2023</b> -
        <b>12</b> -
        <b>25</b>
        <small>월</small>
      </time>

      <time>
        <small>am</small>
        <b>12</b> :
        <b>25</b> :
        <b>30</b> 
      </time>

    </div>
  );
};

export default CompTime;
